import Link from "next/link";

const Logo = () => (
  <div>
    <div>
      <Link href="/">
        <a className="logo" style={{ fontFamily: "Sectra" }}>
          >O
        </a>
      </Link>
    </div>
    {style}
  </div>
);

const style = (
  <style jsx>{`
    a {
      color: var(--color2);
    }
    .logo {
      font-size: 3rem;
      color: var(--color2);
      margin-left: var(--global-margin);
      margin-top: 1rem;
    }
  `}</style>
);

export default Logo;
